pragma solidity ^0.5.16;

contract IDProof {

  address public admin;
  address public user;

  uint256 public BookCount = 0;
  uint256 public IDProofCount = 0;

  constructor() public {
      admin = msg.sender;
      user = msg.sender;
  }

  struct Book {
    uint256 book_Id;
    string book_Hash;
    uint256 book_Size;
    string book_Name;
    string book_Description;
    string author;
    uint256 isbn;
    uint256 uploadTime;
    address uploader;
  }
  mapping(uint256 => Book) public books;

  struct ProofID {
    uint256 proof_Id;
    string proofId_Hash;
    uint256 proofId_Size;
    string username;
    string houseaddress;
    string phonenumber;
    string emailid;
    uint256 uploadTime;
    address uploader;
    uint reports;
  }

  mapping(uint256 => ProofID) public userproof;

  struct Reporter{
        bool reported;
    }

  mapping(address => mapping(uint =>  Reporter)) public reporters;

  event BookUploaded(uint256 book_Id,string book_Hash,uint256 book_Size,string book_Name,string book_Description,string author,uint256 isbn,uint256 uploadTime,address uploader);
  event NoteUploaded(uint256 proof_Id,string proofId_Hash,uint256 proofId_Size,string username,string houseaddress,string phonenumber,string emailid,uint256 uploadTime,address uploader);



  modifier onlyadmin(){
        require(msg.sender==admin,"Only Admin can access this");
        _;
    }

  modifier onlylibrarian(){
        require(msg.sender==user,"Only user can access this");
        _;
    }

  modifier onlyUploaderorLibrarian(uint256 _index){
        require(msg.sender==userproof[_index].uploader || msg.sender==user,"Only ProofID Uploader can access this");
        _;
    }

  modifier notuploader(uint256 _index){
        require(msg.sender!=userproof[_index].uploader,"Uploader can't report userproof");
        _;
    }

  function changelibrarian(address _librarian) public onlyadmin() {
        require(msg.sender != address(0));
        user = _librarian;
    }


  function deletebook(uint index) public onlylibrarian(){
      require(msg.sender != address(0));
      require(BookCount > 0 && index <= BookCount, "Unable to Delete!");
      if(index != BookCount){
        books[index]= Book(index,books[BookCount].book_Hash,books[BookCount].book_Size,books[BookCount].book_Name,books[BookCount].book_Description,books[BookCount].author,books[BookCount].isbn,books[BookCount].uploadTime,books[BookCount].uploader);
        books[BookCount]= Book(0,"",0,"","","",0,0,address(0));
        BookCount --;}
      else
      {
        books[index]= Book(0,"",0,"","","",0,0,address(0));
        BookCount--;
      }
    }

  function uploadBook(string memory _book_Hash,uint256 _book_Size,string memory _book_Name,string memory _book_Description,string memory _author,uint256 _isbn) public onlylibrarian() {

    require(bytes(_book_Hash).length > 0);
    require(bytes(_book_Name).length > 0);
    require(bytes(_book_Description).length > 0);
    require(bytes(_author).length > 0);
    require(_isbn > 0);
    require(msg.sender != address(0));
    require(_book_Size > 0);

    BookCount++;

    books[BookCount] = Book(BookCount,_book_Hash,_book_Size,_book_Name,_book_Description,_author,_isbn,now,msg.sender);

    emit BookUploaded(BookCount,_book_Hash,_book_Size,_book_Name,_book_Description,_author,_isbn,now,msg.sender);
  }



  function uploadNote(string memory _proofId_Hash,uint256 _proofId_Size,string memory username,string memory houseaddress,string memory phonenumber,string memory email) public {
    //stream = username, subject code = houseaddress, teacher = phonenumber , date = email


    require(bytes(_proofId_Hash).length > 0);
    require(bytes(houseaddress).length > 0);
    require(bytes(phonenumber).length > 0);
    require(bytes(email).length > 0);
    require(_proofId_Size > 0);
    require(msg.sender != address(0));


    IDProofCount++;

    userproof[IDProofCount] = ProofID(IDProofCount,_proofId_Hash,_proofId_Size,username,houseaddress,phonenumber,email,now,msg.sender,0);
    emit NoteUploaded(IDProofCount,_proofId_Hash,_proofId_Size,username,houseaddress,phonenumber,email,now,msg.sender);
    }

  function deletenote(uint index) public onlyUploaderorLibrarian(index){
        require(msg.sender != address(0));
        require(IDProofCount > 0 && index <= IDProofCount, "Unable to Delete!");
        if(index != IDProofCount){
        userproof[index]= ProofID(index,userproof[IDProofCount].proofId_Hash,userproof[IDProofCount].proofId_Size,userproof[IDProofCount].username,userproof[IDProofCount].houseaddress,userproof[IDProofCount].phonenumber,userproof[IDProofCount].emailid,userproof[IDProofCount].uploadTime,userproof[IDProofCount].uploader,0);
        userproof[IDProofCount]= ProofID(0,"",0,"","","","",0,address(0),0);
        IDProofCount --;}
        else
        {
            userproof[index]= ProofID(0,"",0,"","","","",0,address(0),0);
            IDProofCount--;
        }
    }
  // function reportnote(uint index) public notuploader(index){
  //   require(msg.sender != address(0));
  //   uint before = userproof[index].reports;
  //   // require(!reporters[msg.sender].reported);
  //   if(reporters[msg.sender][index].reported==false){

  //   before++;
  //   userproof[index].reports = before;
  //   reporters[msg.sender][index].reported=true;
  //   }
  //   else{
  //   before--;
  //   userproof[index].reports = before;
  //   reporters[msg.sender][index].reported=false;
  //   }
  // }
}
